import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-overlay">
        <h1>Welcome to the AI Travel Planner</h1>
        <p>Discover amazing places, create unforgettable memories, and plan your next adventure with our personalized travel recommendations.</p>
        <a href="#recommendations" className="cta-button">Start Exploring</a>
      </div>
    </div>
  );
};

export default Home;
